import React, { useState } from 'react';

function VideoSearchForm({ onFetchChunks, loading }) {
  const [urlInput, setUrlInput] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!urlInput) return;
    onFetchChunks(urlInput);
  };
}

export default VideoSearchForm;
